import React , {useEffect} from 'react'
import axios from 'axios'

const NewHome = () => {
  axios.defaults.withCredentials = true;

  useEffect(()=>{
    axios.get("http://localhost:5000/api/login").then((response)=>{
      console.log(response);
    })
  }, [])
  return (
    <div>NewHome</div>
  )
}

export default NewHome
